import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import TodoList from './components/todoList';
const { useState } = React;
const App = ()=> 
{
    let [todos, setTodos] = useState(getToDos());
    return (
      <div className="App">
        <TodoList todos={todos}>

        </TodoList>
      </div>
    );
}

function getToDos() {
  return [
    {
      name: ""
    }
  ]
}

export default App;
